import React, { useState } from "react";

import Box from "@mui/material/Box";
import Button from "@mui/material/Button";
import FormControl from "@mui/material/FormControl";
import InputLabel from "@mui/material/InputLabel";
import MenuItem from "@mui/material/MenuItem";
import Select from "@mui/material/Select";
import Stack from "@mui/material/Stack";
import Typography from "@mui/material/Typography";
import { useTheme } from "@mui/material/styles";
import Footer from "../Footer/Footer";
import { ListMenuClass } from "../ListMenuKelasPage/ListMenuKelasPage";
import { useNavigate } from "react-router-dom";

const DetailKelasPage = () => {
  const theme = useTheme();
  const primaryColor = theme.palette.primary.main;
  const gray1 = theme.palette.gray1.main;
  const gray3 = theme.palette.gray3.main;
  const poppins = theme.typography.poppins.fontFamily;
  const navigate = useNavigate();

  const buttonStyle = {
    width: "234px",
    textTransform: "none",
    color: primaryColor,
    borderRadius: "8px",
  };

  const [schedule, setSchedule] = useState("");

  const handleChange = (event) => {
    setSchedule(event.target.value);
  };

  return (
    <Stack spacing="178px">
      <div>
        <Stack
          spacing={5}
          sx={{
            width: "1140px",
            margin: "0 auto",
            marginTop: "40px",
            marginBottom: "160px",
            textAlign: "left",
          }}
        >
          <Stack direction="row" spacing={5}>
            <Box>
              <img src="./classcarddetailimg.svg" width="400" height="267" />
            </Box>
            <Stack spacing="60px">
              <Stack spacing={4}>
                <Stack spacing={1}>
                  <Typography
                    paragraph={true}
                    sx={{ margin: "0", color: gray3 }}
                  >
                    Asian
                  </Typography>
                  <Typography
                    variant="h5"
                    component="h1"
                    sx={{ fontWeight: "600", color: gray1 }}
                  >
                    Tom Yum Thailand
                  </Typography>
                  <Typography
                    variant="h5"
                    component="h2"
                    color="primary"
                    sx={{ fontWeight: "600" }}
                  >
                    IDR 450.000
                  </Typography>
                </Stack>

                <FormControl sx={{ width: "300px", height: "40px" }}>
                  <InputLabel id="select-schedule-label">
                    Select Schedule
                  </InputLabel>
                  <Select
                    labelId="select-schedule-label"
                    label="Select Schedule"
                    value={schedule}
                    onChange={handleChange}
                  >
                    <MenuItem value="25-07-2022">Monday, 25 July 2022</MenuItem>
                    <MenuItem value="26-07-2022">
                      Tuesday, 26 July 2022
                    </MenuItem>
                    <MenuItem value="27-07-2022">
                      Wednesday, 27 July 2022
                    </MenuItem>
                    <MenuItem value="28-07-2022">
                      Thursday, 28 July 2022
                    </MenuItem>
                    <MenuItem value="29-07-2022">Friday, 29 July 2022</MenuItem>
                    <MenuItem value="30-07-2022">
                      Saturday, 30 July 2022
                    </MenuItem>
                  </Select>
                </FormControl>
              </Stack>

              <Stack direction="row" spacing={2}>
                <Button variant="outlined" color="primary" sx={buttonStyle}>
                  Add to Cart
                </Button>
                <Button variant="contained" color="secondary" sx={buttonStyle}
                onClick={()=>navigate('/checkout')}>
                  Buy Now
                </Button>
              </Stack>
            </Stack>
          </Stack>

          <Stack spacing={2}>
            <Typography
              variant="h5"
              component="h3"
              sx={{ color: gray1, fontWeight: "600" }}
            >
              Description
            </Typography>

            <Stack spacing={3}>
              <Typography
                paragraph={true}
                sx={{ color: gray1, marginBottom: "0" }}
              >
                Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
                eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut
                enim ad minim veniam, quis nostrud exercitation ullamco laboris
                nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor
                in reprehenderit in voluptate velit esse cillum dolore eu fugiat
                nulla pariatur. Excepteur sint occaecat cupidatat non proident,
                sunt in culpa qui officia deserunt mollit anim id est laborum.
              </Typography>

              <Typography
                paragraph={true}
                sx={{ color: gray1, fontFamily: poppins }}
              >
                Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
                eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut
                enim ad minim veniam, quis nostrud exercitation ullamco laboris
                nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor
                in reprehenderit in voluptate velit esse cillum dolore eu fugiat
                nulla pariatur. Excepteur sint occaecat cupidatat non proident,
                sunt in culpa qui officia deserunt mollit anim id est laborum.
              </Typography>
            </Stack>
          </Stack>
        </Stack>

        <ListMenuClass />
      </div>

      {/* <Footer /> */}
    </Stack>
  );
};

export default DetailKelasPage;
